import * as zrUtil from 'zrender/src/core/util';
import VisualMapView from './VisualMapView';
import * as graphic from '../../util/graphic';
import {createSymbol} from '../../util/symbol';
import * as layout from '../../util/layout';
import * as helper from './helper';

// add by dolkkok
var curry = zrUtil.curry;

// Group 설정 -- this 설정 필요
function setGroup() {
    // -- add by dolkkok
    // #201710804-03 : 페이징처리가 필요없는 경우는 페이지 영역 삭제
    if(this.pageList.length <= 1) this.group.removeAll();
    var pageItems = this.pageList[ this.page - 1 ];
    for( var idx = 0, nMax = pageItems.length; idx < nMax; idx++ ) {
        this.group.add( pageItems[ idx ] );
    }
}	// Method - setGroup

var PiecewiseVisualMapView = VisualMapView.extend({

    type: 'visualMap.piecewise',

        // add by dolkkok
    btn_next_disable : 'data:image/jpeg;base64,',
    btn_next : 'data:image/jpeg;base64,',
    btn_prev_disable : 'data:image/jpeg;base64,',
    btn_prev : 'data:image/jpeg;base64,',

    /**
     * @protected
     * @override
     */
    doRender: function () {
        var thisGroup = this.group;

        thisGroup.removeAll();

        var visualMapModel = this.visualMapModel;
        var textGap = visualMapModel.get('textGap');
        var textStyleModel = visualMapModel.textStyleModel;
        var textFont = textStyleModel.getFont();
        var textFill = textStyleModel.getTextColor();
        var itemAlign = this._getItemAlign();
        var itemSize = visualMapModel.itemSize;
        var viewData = this._getViewData();
        var endsText = viewData.endsText;
        var showLabel = zrUtil.retrieve(visualMapModel.get('showLabel', true), !endsText);

        endsText && this._renderEndsText(
            thisGroup, endsText[0], itemSize, showLabel, itemAlign
        );

        // -- add by dolkkok - #20161219-01 : VisualMap Paging--- Start
        this.pageItems 	= visualMapModel.get( 'pageItems' );
        this.usePage	= false;
        this.pageList  	= null;
        // - add by dolkkok
        // page영역을 제외한 grid 영역 너비
        // 전체page/현재page가 값에따라 page영역이 달라질수는 있으나, 최대 너비를 기준으로 계산
        this.chartWidth         = this.api.getWidth() - 100;
        // - add by dolkkok
        // 범례가 render될때마다 갱신되는 범례영역 너비
        this.currentLegnedWidth = 0;
        this.page		= visualMapModel.get( 'page' );
        if( 0 != this.pageItems ) {
            this.usePage	= true;
            this.pageList 	= [];
        }
        // -- add by dolkkok - #20161219-01 : VisualMap Paging --- End


        zrUtil.each(viewData.viewPieceList, renderItem, this);

        // -- add by dolkkok - #20161219-01 : VisualMap Paging --- Start
        if( this.usePage ) {

            var _this = this;
            var nTotalPage = this.pageList.length;
            // -- add by dolkkok
            // #201710413-01 : resize시마다 변경될 수 있는 전체페이지/현재 페이지 체크
            if(!this.pageList[ this.page - 1 ]) this.page = nTotalPage;

            // 숫자 자릿수 계산
            var tempCurrPage 	= this.page;
            var nCurrPageWidth 	= 7;
            while( 9 < tempCurrPage ) {
                nCurrPageWidth += 7;
                tempCurrPage = tempCurrPage / 10;
            }

            var tempTotalPage	= nTotalPage;
            var nTotalPageWidth	= 7;
            while( 9 < tempTotalPage ) {
                nTotalPageWidth += 7;
                tempTotalPage = tempTotalPage / 10;
            }

            var nPageTxtWidth = nCurrPageWidth + nTotalPageWidth + 26;

            var btnPrevPage = new graphic.Image({
                style	: {
                    x : 0,
                    y : 0,
                    width : 20,
                    height : 20,
                    image : ( 1 == this.page ) ? this.btn_prev_disable : this.btn_prev
                }
            });
            var pageTxt = new graphic.Text({
                style: {
                    text	: this.page + ' / ' + nTotalPage,
                    x		: 30,
                    y		: 12,
                    width	: nPageTxtWidth,
                    fill	: '#000000',
                    textVerticalAlign: 'middle'
                },
                silent 	: true
            });
            var btnNextPage = new graphic.Image({
                style	: {
                    x : nPageTxtWidth + 20,
                    y : 0,
                    width : 20,
                    height : 20,
                    image : ( this.page == this.pageList.length ) ? this.btn_next_disable : this.btn_nexzt
                }
            });

            var itemGroup = new graphic.Group( { id : 'pager' } );
            itemGroup.add( btnPrevPage );
            itemGroup.add( pageTxt );
            itemGroup.add( btnNextPage );
            thisGroup.add( itemGroup );

            btnPrevPage.on(
                'click',
                curry(
                    function() {

                        // 페이지 이동
                        ( 1 < _this.page ) && ( _this.page-- );

                        // 페이지 정보 저장
                        visualMapModel.mergeOption( { 'page' : _this.page } );

                        // 변경 적용
                        _this.doRender();

                    }, this.api
                )
            );
            btnNextPage.on(
                'click',
                curry(
                    function() {

                        // 페이지 이동
                        ( _this.pageList.length > _this.page ) && ( _this.page++ );

                        // 페이지 정보 저장
                        visualMapModel.mergeOption( { 'page' : _this.page } );

                        // 변경 적용
                        _this.doRender();

                    }, this.api
                )
            );

            // append legend
            setGroup.apply( this );
        }
        // -- add by dolkkok - #20161219-01 : VisualMap Paging --- End

        endsText && this._renderEndsText(
            thisGroup, endsText[1], itemSize, showLabel, itemAlign
        );

        layout.box(
            visualMapModel.get('orient'), thisGroup, visualMapModel.get('itemGap')
        );

        this.renderBackground(thisGroup);

        this.positionGroup(thisGroup);

        function renderItem(item) {
            var piece = item.piece;

            var itemGroup = new graphic.Group();
            itemGroup.onclick = zrUtil.bind(this._onItemClick, this, piece);

            this._enableHoverLink(itemGroup, item.indexInModelPieceList);

            var representValue = visualMapModel.getRepresentValue(piece);

            this._createItemSymbol(
                itemGroup, representValue, [0, 0, itemSize[0], itemSize[1]]
            );

            if (showLabel) {
                var visualState = this.visualMapModel.getValueState(representValue);

                itemGroup.add(new graphic.Text({
                    style: {
                        x: itemAlign === 'right' ? -textGap : itemSize[0] + textGap,
                        y: itemSize[1] / 2,
                        text: piece.text,
                        textVerticalAlign: 'middle',
                        textAlign: itemAlign,
                        textFont: textFont,
                        textFill: textFill,
                        opacity: visualState === 'outOfRange' ? 0.5 : 1
                    }
                }));
            }

            // -- add by dolkkok - #20161219-01 : VisualMap Paging --- Start
            if (this.usePage) {
                var nPages = this.pageList.length;
                var itemWidth = itemGroup.getBoundingRect().width + visualMapModel.option.itemGap;
                // -- add by dolkkok
                // #201710413-02 : 차트화면과 현재까지 추가된 범례사이즈의 너비를 비교후 페이지 지정
                if (0 == nPages || this.currentLegnedWidth + itemWidth > this.chartWidth) {
                    var newPage = [];
                    newPage.push(itemGroup);
                    this.pageList.push(newPage);
                    if (nPages != 0) this.currentLegnedWidth = 0;
                }
                else {
                    var currentPage = this.pageList[nPages - 1];
                    // -- add by dolkkok
                    // #201710804-02 : 페이지당 범례 개수를 초과하면 다음페이지에 생성
                    if (legendModel.get('pageItems') <= currentPage.length) {
                        var newPage = [];
                        newPage.push(itemGroup);
                        this.pageList.push(newPage);
                        if (nPages != 0) this.currentLegnedWidth = 0;
                    } else {
                        currentPage.push(itemGroup);
                    }
                }
                // -- add by dolkkok
                this.currentLegnedWidth += itemWidth;
            }
            else {
                thisGroup.add(itemGroup);
            }
            // -- add by dolkkok - #20161219-01 : VisualMap Paging --- End
        }
    },

    /**
     * @private
     */
    _enableHoverLink: function (itemGroup, pieceIndex) {
        itemGroup
            .on('mouseover', zrUtil.bind(onHoverLink, this, 'highlight'))
            .on('mouseout', zrUtil.bind(onHoverLink, this, 'downplay'));

        function onHoverLink(method) {
            var visualMapModel = this.visualMapModel;

            visualMapModel.option.hoverLink && this.api.dispatchAction({
                type: method,
                batch: helper.convertDataIndex(
                    visualMapModel.findTargetDataIndices(pieceIndex)
                )
            });
        }
    },

    /**
     * @private
     */
    _getItemAlign: function () {
        var visualMapModel = this.visualMapModel;
        var modelOption = visualMapModel.option;

        if (modelOption.orient === 'vertical') {
            return helper.getItemAlign(
                visualMapModel, this.api, visualMapModel.itemSize
            );
        }
        else { // horizontal, most case left unless specifying right.
            var align = modelOption.align;
            if (!align || align === 'auto') {
                align = 'left';
            }
            return align;
        }
    },

    /**
     * @private
     */
    _renderEndsText: function (group, text, itemSize, showLabel, itemAlign) {
        if (!text) {
            return;
        }

        var itemGroup = new graphic.Group();
        var textStyleModel = this.visualMapModel.textStyleModel;

        itemGroup.add(new graphic.Text({
            style: {
                x: showLabel ? (itemAlign === 'right' ? itemSize[0] : 0) : itemSize[0] / 2,
                y: itemSize[1] / 2,
                textVerticalAlign: 'middle',
                textAlign: showLabel ? itemAlign : 'center',
                text: text,
                textFont: textStyleModel.getFont(),
                textFill: textStyleModel.getTextColor()
            }
        }));

        group.add(itemGroup);
    },

    /**
     * @private
     * @return {Object} {peiceList, endsText} The order is the same as screen pixel order.
     */
    _getViewData: function () {
        var visualMapModel = this.visualMapModel;

        var viewPieceList = zrUtil.map(visualMapModel.getPieceList(), function (piece, index) {
            return {piece: piece, indexInModelPieceList: index};
        });
        var endsText = visualMapModel.get('text');

        // Consider orient and inverse.
        var orient = visualMapModel.get('orient');
        var inverse = visualMapModel.get('inverse');

        // Order of model pieceList is always [low, ..., high]
        if (orient === 'horizontal' ? inverse : !inverse) {
            viewPieceList.reverse();
        }
        // Origin order of endsText is [high, low]
        else if (endsText) {
            endsText = endsText.slice().reverse();
        }

        return {viewPieceList: viewPieceList, endsText: endsText};
    },

    /**
     * @private
     */
    _createItemSymbol: function (group, representValue, shapeParam) {
        group.add(createSymbol(
            this.getControllerVisual(representValue, 'symbol'),
            shapeParam[0], shapeParam[1], shapeParam[2], shapeParam[3],
            this.getControllerVisual(representValue, 'color')
        ));
    },

    /**
     * @private
     */
    _onItemClick: function (piece) {
        var visualMapModel = this.visualMapModel;
        var option = visualMapModel.option;
        var selected = zrUtil.clone(option.selected);
        var newKey = visualMapModel.getSelectedMapKey(piece);

        if (option.selectedMode === 'single') {
            selected[newKey] = true;
            zrUtil.each(selected, function (o, key) {
                selected[key] = key === newKey;
            });
        }
        else {
            selected[newKey] = !selected[newKey];
        }

        this.api.dispatchAction({
            type: 'selectDataRange',
            from: this.uid,
            visualMapId: this.visualMapModel.id,
            selected: selected
        });
    }
});

export default PiecewiseVisualMapView;
